import React from 'react';
import web from "../src/images/getstarted.jpg";
import { NavLink } from 'react-router-dom';
import Common from './Common';


const Home = () => {
	return (
		<>
			<Common name="Gro Your Business" imgsrc={web} visit="/service" btname="Get started" />
		</>
	);
}

export default Home;
